import React from 'react';
import './Card.css';

const Card = ( {name, email, imgUrl }) => {
    
    return (
        
        <div className="card">
            <img src={props.imgUrl} className="card-img-top" alt="">
            </img>
            <div className="card-body">
                <h5 className="card-title">{props.name}</h5>
                <p className="card-text">{props.email}</p>
            </div>
        </div>

    );
}

export default Card;
